import React, { useState } from "react";

import "../profile/style-profile.css";
import Header from "../../components/Header";
import Footer from "../../components/Footer";
import AboutButton from "../../components/btns/AboutButton";
import ContactButton from "../../components/btns/ContactButton";
import TempoGoals from "../profile/mains/TempoGoals";
import ContGoalsTD from "../profile/mains/ContGoalsTD";
import ContGoalsAD from "../profile/mains/ContGoalsAD";
import LimitedActivities from "../profile/mains/LimitedActivities";
import ForbiddenActivities from "../profile/mains/ForbiddenActivities";
import SocialGatherings from "../profile/mains/SocialGatherings";
import SignUpBtn from "../../components/btns/SignUpBtn";
import LoginBtn from "../../components/btns/LoginBtn";
import ForumBtn from "../../components/btns/ForumBtn";
import Ideas from "../profile/mains/Ideas";
import GenericWrapper from "../../components/GenericWrapper";
import Hobbies from "../profile/mains/Hobbies";
import MotivatorBtn from "../../components/btns/MotivatorBtn";
import TodoBtn from "../../components/btns/TodoBtn";
import MotiTable from "./MotiTable";

function Motivator() {
  const tempoGoalsData = [
    {
      goal: "Change career path",
      action: "Study and get a coding job",
      id: 0.7419944699444685,
    },
    {
      goal: "Linda's present",
      action: "Check a concert to go",
      id: 0.7419944699232888,
    },
    {
      goal: "Belen bills",
      action: "Pay 5 of them at the end of the month",
      id: 0.7419576879444222,
    },
    {
      goal: "Fighter hair",
      action: "Cut hair to have better sight",
      id: 0.7419222699444222,
    },
    {
      goal: "Bea email",
      action: "Mirar lo del Kaution ",
      id: 0.7419228888844222,
    },
    {
      goal: "Depilano",
      action: "You know",
      id: 0.7412348888844222,
    },
    {
      goal: "Sweeden flights",
      action: "Check with friends (Joakim)",
      id: 0.7412343328844222,
    },
  ];

  const titles3col = [
    {
      type: "temporary goals",
      col1: repTitles[0],
      col2: "What has to happen to accomplish it?",
      col3: repTitles[1],
    },
    {
      type: "forbidden activities",
      col1: repTitles[0],
      col2: "Until when?",
      col3: repTitles[1],
    },
    {
      type: "ideas",
      col1: "Idea",
      col2: "Comments",
      col3: repTitles[1],
    },
    {
      type: "ideas",
      col1: "Hobby",
      col2: "Comments",
      col3: repTitles[1],
    },
  ];
  const titles4col = [
    {
      type: "cont. goals (time dependent)",
      col1: repTitles[0],
      col2: repTitles[2],
      col3: "For how long?",
      col4: repTitles[1],
    },
    {
      type: "cont. goals (action dependent)",
      col1: repTitles[0],
      col2: repTitles[2],
      col3: "Which action?",
      col4: repTitles[1],
    },
    {
      type: "limited activities",
      col1: "Activity",
      col2: repTitles[2],
      col3: "Daily time allowed",
      col4: repTitles[1],
    },
    {
      type: "forbidden activities",
      col1: "Activity",
      col2: "For how long?",
      col3: repTitles[1],
    },
    {
      type: "social gatherings",
      col1: "Event",
      col2: "Date",
      col3: "Notes",
      col4: repTitles[1],
    },
  ];

  return (
    <GenericWrapper>
      <Header
        altBtn1={TodoBtn}
        altBtn2={ForumBtn}
        altBtn3={AboutButton}
      ></Header>
      <h2>Welcome to the motivator!</h2>
      <h3>A system to remind you the reason of what you are doing</h3>
      <main className="main-profile-container">
        <TempoGoals
          dataTunnel={tempoGoalsData}
          titlesTunnel={titles3col}
        ></TempoGoals>
        <ContGoalsTD
          dataTunnel={contGoalsTDData}
          titlesTunnel={titles4col}
        ></ContGoalsTD>
        <ContGoalsAD
          dataTunnel={contGoalsADData}
          titlesTunnel={titles4col}
        ></ContGoalsAD>
        <LimitedActivities
          dataTunnel={limitedActivitiesData}
          titlesTunnel={titles4col}
        ></LimitedActivities>
        <ForbiddenActivities
          dataTunnel={forbiddenActivitiesData}
          titlesTunnel={titles4col}
        ></ForbiddenActivities>
        <SocialGatherings
          dataTunnel={socialGatheringsData}
          titlesTunnel={titles4col}
        ></SocialGatherings>
        <Ideas dataTunnel={ideasData} titlesTunnel={titles3col}></Ideas>
        <Hobbies dataTunnel={hobbiesData} titlesTunnel={titles3col}></Hobbies>
      </main>
      <Footer></Footer>
    </GenericWrapper>
  );
}

export default Motivator;
